import { Grid, Avatar, Input } from "@mui/material";
import { deepOrange, deepPurple } from "@mui/material/colors";

const AddTwist = () => {
  return (
    <Grid container columnSpacing={2}>
      <Grid item>
        <Avatar alt="userAvatar" sx={{ bgcolor: deepOrange[500] }}>
          HC
        </Avatar>
      </Grid>
      <Grid item xs={6}>
        <Input
          type="text"
          placeholder="Azul"
          disableUnderline
          multiline
          maxRows={4}
        ></Input>
      </Grid>
    </Grid>
  );
};

export default AddTwist;
